  false,\n\t\"url\": null,\n\t\"notes\": \"This combined Annual Habitat Work Plan
  (AHWP) for Fish Springs National Wildlife Refuge provides a report on habitat management
  activities for years 2010- 2012 and it provides a transitional step toward use of
  the Habitat Management Plan (HMP) as the foundation for AHWP writing in 2013 and
  future years. Reporting for years 2010-2012 follows CCP objectives within sections
  II Habitat Objectives, III Habitat Response, and IV Wildlife Response of this AHWP,
  whereas planned management strategies for year 2013 (section VII) transition to
  use of HMP objectives.  This report provides information on habitat management strategies
  and inventory and monitoring on Fish Springs National Wildlife Refuge during 2010-2012.\",\n\t\"license_title\":
